import React from 'react';

const navbar = () => {
  return (
    <nav>
      <div>
        <span>Telstra</span>
      </div>
      <div>
        
        <ul>
          <li>Home</li>
          <li><a href="http://localhost:3000/">Login</a></li>
        </ul>
      </div>

      <div>
        <br/>
        <h1>Welcome please login to access your account</h1>
    </div>
    </nav>
    
    
  );
};
